The story of a bird tengu with a soft spot for Kuro, a black dog he picked up one rainy day.  But Kuro's true nature is that of a dog tengu, a harbinger of calamity.

&quot;I'll bring you misfortune.&quot;
&quot;So what? Stay with me, Kuro.&quot;

In his human form, Kuro can't hold himself back when faced with the sweet fragrance of the bird tengu he loves. And so they share their first time and first heats with each other. They won't stop until they're satisfied.

